import React from 'react';
import { Container, Row } from 'react-bootstrap';
import Navigation from '../navigation/navigation';

const layout = (props) => {
    return (
        <Container>
            <Row>
                <Navigation/>
            </Row>
            <main>
                {props.children}
            </main>
            <Outlet/>
        </Container>
    )
}

export default layout;


const Layout = () => {
    return (
        <div className="layout">
            <Outlet />
        </div>
    );
};
